import Vue from 'vue'
import App from './App.vue'
// import Element from 'element-ui'
import 'element-ui/lib/theme-chalk/index.css'

import {Button} from "element-ui";

Vue.config.productionTip = false

// 全局注入
// Vue.use(Element)
Vue.use(Button)

new Vue({
  render: h => h(App),
}).$mount('#app')
